import React from "react";

function Home() {
  return (
    <React.Fragment>
      <div className="container text-uppercase">
        <h1 className="text-center m-5"> The Smartest Way of buyuing a car</h1>
        <p>Hello</p>
      </div>

      <div class="container">
        <div class="row">
          <div class="col-sm">
            <h1 className="text-center m-5">
              {" "}
              The Smartest Way of buyuing a car
            </h1>
          </div>
          <div class="col-sm">One of three columns</div>
        </div>
      </div>
    </React.Fragment>
  );
}
export default Home;
